import { combineReducers } from '@reduxjs/toolkit';
import AuthReducer from "./reducer-auth";
import MainReducer from './main-reducer';

const rootReducer = combineReducers({
  auth: AuthReducer,
  main: MainReducer,
});
export default rootReducer;
